class Solution {
public:
    int minExtraChar(string s, vector<string>& dictionary) {
        set<string> st(dictionary.begin(), dictionary.end());
        int n = s.size();
        vector<int> minExtra(n+1, n);
        minExtra[0] = 0;
        for (int i = 1; i <= n; ++i) {
            minExtra[i] = minExtra[i-1] + 1;
            for (int j = 0; j < i; ++j) {
                if (st.find(s.substr(j, i-j)) != st.end()) {
                    minExtra[i] = min(minExtra[i], minExtra[j]);
                }
            }
        }
        return minExtra[n];
    }
};
```
In the repaired code, we first convert the dictionary to a set for efficient lookup. Then we initialize minExtra[0] = 0 and for each position i in the string, we set minExtra[i] = minExtra[i-1] + 1. Then for each substring of length i, we check if it is in the set. If it is, we update minExtra[i] to be the minimum of itself and minExtra[j] where j is the position of the beginning of the substring. Finally, we return minExtra[n], where n is the length of the string.
